class TestCollector(TestCase):
    def setUp(self):
        # self.collector = MockCollector()
        self.collector = Collector()

    def test_historical(self):
        data = self.collector.historical('TOST', 60)
        print(data.head())
        print(data.dtypes)
        print(data.shape)

    def test_historical_slice(self):
        data = self.collector.historical_slice('TOST', 60, 'year1month1')
        print(data.head())
        print(data.dtypes)
        print(data.shape)

    def test_realtime(self):
        for i in ('NXYZ', 'TOST', 'tost'):
            try:
                print(self.collector.realtime(i))
            except:
                pass

    def test_lookup_symbol(self):
        self.assertFalse(self.collector.lookup_symbol('NXYZ'))
        self.assertTrue(self.collector.lookup_symbol('TOST'))
        self.assertFalse(self.collector.lookup_symbol('tost'))
